import pic from "../../pics/weatherDashboard.png";

export default function WeatherBashboard() {
  return (
    <div className="project-div">
      <a href="https://karenharley.github.io/Weather-Dashboard/">
      <a href="https://github.com/KarenHarley/Weather-Dashboard">Weather Dashboard <i class="bx bxl-github"></i></a>
        <img src={pic} alt="weather dashboard pic" />

      </a>
    </div>
  );
}

